import React from 'react';

import {  NavBar, Header, Upload , About, Examples, Supported, Footer, ModalGroup} from './components';

import 'bootstrap/dist/css/bootstrap.min.css';
const App = () => {
    return (
        <>
            <NavBar/>
            <Header/>
            <Upload/>
            {/* modal */}
           
            <About/>
            <Examples/>
            <Supported/>
            <Footer/>
        </>
    )
}

export default App;
